import './App.css';
import monitor from './static/media/monitor.jpg'; 
import Navbar from './components/navbar'
import Footer from './components/footer'
import Home from "./components/home"
import E_booklick from "./components/e_booklick"
import {Switch, Route } from "react-router-dom";


function App() {
  /* 
  const { isLoading } = useAuth0();

  if (isLoading) {
    return <Loading />;
  }
   */
  return (
    <>
        <br></br>
        <Navbar></Navbar>
          <Switch>
              <Route path="/" exact />
              <Route
                path="/inventario/equipos/:idEquipo"
                component={Home}
                />
              <Route
                path="/inventario/crearEquipo"
                component={e_univ}
              />
          </Switch>
        <Footer></Footer>

  </>
  );
}
export default App;
